import 'Data.dart';class UserModel {  UserModel({      this.status,       this.message,       this.data,       this.token,  });  UserModel.fromJson(dynamic json) {    status = json['status'];    message = json['message'];    data = json['data'] != null ? UserData.fromJson(json['data']) : null;    token = json['token'];  }  int ?status;  String? message;  UserData? data;  String? token;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['status'] = status;    map['message'] = message;    if (data != null) {      map['data'] = data!.toJson();    }    map['token'] = token;    return map;  }}